import { createUseStyles } from 'react-jss';
var useStyles = createUseStyles({
    Text: {
        display: 'block',
        fontSize: 14,
        lineHeight: '20px',
    },
    textParent: {
        display: 'inline',
    },
    flex: {
        flex: 1
    },
    absolute: {
        position: 'absolute',
    }
});
export { useStyles, };
